import React from "react";
import "./App.css";

const App = () => {
  return (
    <div className=''>
      <header>
        <img src="https://cdn.worldvectorlogo.com/logos/nasa-3.svg"></img>
      </header>
      <nav>
        <ul>
          <li>Profile</li>
        </ul>
        <ul>
          <li>Messages</li>
        </ul>
        <ul>
          <li>Main Content</li>
        </ul>        
      </nav>
    </div>
  );
};

export default App;
